/**
 * {@inheritDoc}
 *
 * For population size {@code N}, number of successes {@code m}, and sample
 * size {@code n}, the mean is {@code n * m / N}.
 */
public double getNumericalMean() {
    int N = getPopulationSize();
    int m = getNumberOfSuccesses();
    int n = getSampleSize();
    return n * ((double) m / N);
}
